#define RAD2DEG( x )  ( (float)(x) * (float)(180.f / M_PI) )
bool FakeEdge(float& angle);

bool FakeEdge(float& angle)
{

	float edge_dist = 128;
	QVector position = g_Local.vEye;
	float closest_distance = 100.0f;
	float radius = edge_dist + 0.1f;
	float step = M_PI * 2.0 / 8;

	for (float a = 0; a < (M_PI * 2.0); a += step)
	{
		Vector location(radius * cos(a) + position.x, radius * sin(a) + position.y, position.z);

		pmtrace_t tr;

		g_Engine.pEventAPI->EV_SetTraceHull(2);
		g_Engine.pEventAPI->EV_PlayerTrace(position, location, PM_GLASS_IGNORE, -1, &tr);

		float distance = position.Distance((QVector)tr.endpos);

		if (distance < closest_distance)
		{
			closest_distance = distance;
			angle = RAD2DEG(a);
		}
	}

	return closest_distance < edge_dist;
}

void AntiAim(struct usercmd_s* cmd)
{
	g_Local.vViewAngles = cmd->viewangles;
	if (!g_Local.Death)
	{
		int m_Use = (cmd->buttons & IN_USE);
		int m_InAttack = (cmd->buttons & IN_ATTACK);
		int m_InAttack2 = (cmd->buttons & IN_ATTACK2);

		if (!m_Use && !(m_InAttack) && !(m_InAttack2))
		{
			FixMoveStart(cmd);

			int id = NULL;
			float flDist = 8192.f;

			for (unsigned int i = 1; i < 33; i++)
			{
				cl_entity_s* entindex = g_Engine.GetEntityByIndex(i);
				cl_entity_s* entlocal = g_Engine.GetLocalPlayer();
				QVector curstate_origin = entindex->curstate.origin;
				if (!entindex || !entlocal)
					continue;

				if (i == entlocal->index)
					continue;

				if (g_LocalPlayer[i].Death)
					continue;

				if (g_Vars.AimTeamselection == 0)
				{
					if (g_LocalPlayer[id].Team == g_Local.Team)
						continue;

				}
				else if (g_Vars.AimTeamselection == 1)
				{
					if (g_LocalPlayer[id].Team != g_Local.Team)
						continue;
				}

				if (curstate_origin.Distance(g_Local.vOrigin) < flDist || id == NULL)
				{
					flDist = curstate_origin.Distance(g_Local.vOrigin);
					id = i;
				}
			}

			Vector vAngles = cmd->viewangles;
			Vector vEye = g_Local.ppmove->origin + g_Local.ppmove->view_ofs;

			cl_entity_s* entindex = g_Engine.GetEntityByIndex(id);
			if (id > 0 && entindex)
				VectorAngles(entindex->origin - vEye, vAngles);

			//Yaw
			if (g_Local.ppmove->velocity.Length2D() > 0)
			{
				if (g_Vars.aa_yaw_while_running > 0)
				{
					if (g_Vars.aa_yaw_while_running == 1)
					{//180
						cmd->viewangles.y = vAngles[1] + 180;
					}
					else if (g_Vars.aa_yaw_while_running == 2)
					{//180 Jitter
						static bool jitter = false;

						if (jitter)
							cmd->viewangles.y = vAngles[1] + 180;
						else
							cmd->viewangles.y = vAngles[1];

						jitter = !jitter;
					}
					else if (g_Vars.aa_yaw_while_running == 3)
					{//Spin
						int spin = 30;
						cmd->viewangles.y = fmod(g_Engine.GetClientTime() * spin * 360.0f, 360.0f);
					}
					else if (g_Vars.aa_yaw_while_running == 4)
					{//Jitter
						static unsigned int m_side = 0;

						if (m_side == 0)
							cmd->viewangles.y = vAngles[1] + 0;
						else if (m_side == 1)
							cmd->viewangles.y = vAngles[1] + 90;
						else if (m_side == 2)
							cmd->viewangles.y = vAngles[1] + 180;
						else if (m_side >= 3) {
							cmd->viewangles.y = vAngles[1] + -90;
							m_side = 0;
						}

						m_side++;
					}
					else if (g_Vars.aa_yaw_while_running == 5) {//Sideway
						static bool jitter = false;

						if (jitter)
							cmd->viewangles.y = vAngles[1] + 90;
						else
							cmd->viewangles.y = vAngles[1] - 90;

						jitter = !jitter;
					}
					else if (g_Vars.aa_yaw_while_running == 6) {//Random
						cmd->viewangles.y = rand() % 361;
						if (cmd->viewangles.y > 180)
							cmd->viewangles.y -= 360;
					}
					else if (g_Vars.aa_yaw_while_running == 7) {//Static
						cmd->viewangles.y = vAngles[1] + g_Vars.aa_yaw_static;
					}
				}

				float angle = cmd->viewangles.y;

				if ((g_Vars.aa_edge == 2 || g_Vars.aa_edge == 3) && FakeEdge(angle))
					cmd->viewangles.y = angle;
			}
			else
			{
				if (g_Vars.aa_yaw > 0)
				{
					if (g_Vars.aa_yaw == 1)
					{//180
						cmd->viewangles.y = vAngles[1] + 180;
					}
					else if (g_Vars.aa_yaw == 2)
					{//180 Jitter
						static bool jitter = false;

						if (jitter)
							cmd->viewangles.y = vAngles[1] + 180;
						else
							cmd->viewangles.y = vAngles[1];

						jitter = !jitter;
					}
					else if (g_Vars.aa_yaw == 3)
					{//Spin
						int spin = 30;
						cmd->viewangles.y = fmod(g_Engine.GetClientTime() * spin * 360.0f, 360.0f);
					}
					else if (g_Vars.aa_yaw == 4)
					{//Jitter
						static unsigned int m_side = 0;

						if (m_side == 0)
							cmd->viewangles.y = vAngles[1] + 0;
						else if (m_side == 1)
							cmd->viewangles.y = vAngles[1] + 90;
						else if (m_side == 2)
							cmd->viewangles.y = vAngles[1] + 180;
						else if (m_side >= 3) {
							cmd->viewangles.y = vAngles[1] + -90;
							m_side = 0;
						}

						m_side++;
					}
					else if (g_Vars.aa_yaw == 5)
					{//Sideway
						static bool jitter = false;

						if (jitter)
							cmd->viewangles.y = vAngles[1] + 90;
						else
							cmd->viewangles.y = vAngles[1] - 90;

						jitter = !jitter;
					}
					else if (g_Vars.aa_yaw == 6)
					{//Random
						cmd->viewangles.y = rand() % 361;
						if (cmd->viewangles.y > 180)
							cmd->viewangles.y -= 360;
					}
					else if (g_Vars.aa_yaw == 7)
					{//Static
						cmd->viewangles.y = vAngles[1] + g_Vars.aa_yaw_static;
					}
				}

				float angle = cmd->viewangles.y;

				if ((g_Vars.aa_edge == 1 || g_Vars.aa_edge == 3 || g_Vars.aa_edge == 4) && FakeEdge(angle))
				{
					cmd->viewangles.y = angle;
				}
			}

			//Pitch
			if (g_Vars.aa_pitch > 0)
			{
				if (g_Vars.aa_pitch == 1)
				{//Fakedown
					cmd->viewangles.x = 180;
				}
				if (g_Vars.aa_pitch == 2)
				{//Random
					cmd->viewangles.x = rand() % 361;
					if (cmd->viewangles.x > 180)
						cmd->viewangles.x -= 360;
				}
			}

			FixMoveEnd(cmd);
		}
	}
}


